Job_Description:
{
  "jobProfile": {
    "JobID": "MLE-001",
    "coreDetails": {
      "title": "Senior Machine Learning Engineer",
      "jobSummary": "We are seeking a highly skilled Machine Learning Engineer to design, build, and deploy scalable AI solutions. You will work closely with data scientists and software engineers to bridge the gap between model development and production deployment, ensuring our AI systems are robust, efficient, and impactful.",
      "employmentType": {
        "agreement": "Employee",
        "schedule": "Full-time",
        "term": "Permanent"
      },
      "jobLocation": {
        "type": "HYBRID",
        "applicantLocationRequirement": "Must be authorized to work in the country and reside within commuting distance of the San Francisco Bay Area hub."
      },
      "customTags": [
        "AI",
        "Engineering",
        "Tech"
      ],
      "extraNotes": "Occasional travel to HQ required for quarterly planning."
    },
    "responsibilities": {
      "keyObjectives": [
        {
          "objective": "Deploy the new recommendation engine to production.",
          "timeframe": "First 90 Days",
          "metric": "Successful API integration with <50ms latency p99."
        },
        {
          "objective": "Optimize training pipelines for cost efficiency.",
          "timeframe": "6 Months",
          "metric": "Reduce cloud compute costs by 20% while maintaining model accuracy."
        },
        {
          "objective": "Establish MLOps best practices.",
          "timeframe": "1 Year",
          "metric": "Implement automated drift detection and retraining workflows for 100% of production models."
        }
      ],
      "dayToDayDuties": [
        "Design and implement machine learning pipelines for data preprocessing, training, and inference.",
        "Collaborate with data scientists to optimize model architectures for speed and scalability.",
        "Containerize models using Docker and orchestrate deployments via Kubernetes.",
        "Monitor model performance in production and troubleshoot degradation issues.",
        "Conduct code reviews and maintain high standards for engineering quality."
      ],
      "customTags": [
        "Backend",
        "Infrastructure"
      ],
      "extraNotes": "Expect a split of 60% coding/engineering and 40% research/modeling."
    },
    "qualifications": {
      "skills": {
        "technical": [
          {
            "skillId": "TECH-001",
            "skillName": "Python",
            "importance": 10,
            "skillDescription": "Advanced proficiency in Python for backend development and data manipulation.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "TECH-002",
            "skillName": "TensorFlow / PyTorch",
            "importance": 9,
            "skillDescription": "Experience building and fine-tuning deep learning models.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "TECH-003",
            "skillName": "Kubernetes / Docker",
            "importance": 8,
            "skillDescription": "Containerization and orchestration for scalable deployment.",
            "requiredProficiency": "Intermediate"
          },
          {
            "skillId": "TECH-004",
            "skillName": "SQL",
            "importance": 7,
            "skillDescription": "Ability to write complex queries for data extraction.",
            "requiredProficiency": "Intermediate"
          }
        ],
        "soft": [
          {
            "skillId": "SOFT-001",
            "skillName": "Problem Solving",
            "importance": 10,
            "skillDescription": "Ability to break down complex system limitations into solvable engineering tasks.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "SOFT-002",
            "skillName": "Communication",
            "importance": 8,
            "skillDescription": "Translating technical constraints to non-technical stakeholders.",
            "requiredProficiency": "Intermediate"
          }
        ]
      },
      "experience": {
        "requiredYears": 3,
        "description": "Minimum of 3 years of professional experience in software engineering with a focus on machine learning, or a dedicated ML role."
      },
      "education": {
        "requiredCredential": "Bachelor's Degree in Computer Science, Mathematics, or related field.",
        "acceptsExperienceInLieu": true
      },
      "customTags": [
        "Seniority: Mid-Senior"
      ],
      "extraNotes": "Publications in NeurIPS or ICML are a plus but not required."
    },
    "evaluationStrategy": {
      "jobDescription": 60,
      "resume": 40
    },
    "customQuestions": [
      {
        "question": "Describe a time you optimized a model's inference time. What techniques did you use?",
        "expectedAnswer": "Candidate should mention quantization, pruning, caching, or architectural changes."
      },
      {
        "question": "How do you handle data drift in a production environment?",
        "expectedAnswer": "Candidate should discuss monitoring distributions and automated retraining triggers."
      }
    ],
    "applicantTasks": [
      {
        "taskId": "TASK-ML-05",
        "maxUploadSizeMB": 10,
        "allowedFormats": [
          "pdf",
          "zip"
        ]
      }
    ],
    "companyContext": {
      "culture": "We are a fast-paced, innovation-driven startup that values autonomy and radical candor. We believe in failing fast and learning faster.",
      "growthOpportunities": "Mentorship program available. Budget allocated for conferences and certifications. Path to Lead Engineer or Engineering Manager positions.",
      "customTags": [
        "Startup",
        "Innovation"
      ],
      "extraNotes": "Friday team lunches and annual retreats."
    },
    "compensation": {
      "salary": {
        "min": 130000,
        "max": 180000,
        "currency": "USD"
      },
      "benefits": [
        "Comprehensive Health, Dental, Vision Insurance",
        "401(k) Matching",
        "Unlimited PTO",
        "Remote Work Stipend",
        "Stock Options"
      ],
      "customTags": [
        "Tier-1"
      ],
      "extraNotes": "Sign-on bonus available for exceptional candidates."
    },
    "meta": {
      "schemaVersion": "1.3",
      "lastUpdated": "2025-10-27T09:00:00Z",
      "completenessStatus": "Complete",
      "missingFields": [],
      "customFields": {
        "internalBudgetCode": "ENG-AI-2025",
        "hiringManager": "Alex Rivera"
      }
    }
  }
}

