      "employmentType": {
        "agreement": "Employee",
        "schedule": "Full-time",
        "term": "Permanent"
      },
      "jobLocation": {
        "type": "TELECOMMUTE",
        "applicantLocationRequirement": "Remote (Americas/Europe time zones preferred)"
      },
      "customTags": [
