        "SaaS",
        "Python"
      ],
      "extraNotes": "Quarterly virtual hackathons and annual in-person meetups."
    },
    "responsibilities": {
      "keyObjectives": [
        {
          "objective": "Migrate legacy monolith to microservices architecture.",
          "timeframe": "1 Year",
          "metric": "Decouple 4 core services with zero downtime and improved fault tolerance."
        },
        {
          "objective": "Reduce API latency.",
          "timeframe": "6 Months",
          "metric": "Optimize database queries and caching to decrease p95 latency by 30%."
        },
        {
          "objective": "Elevate code quality standards.",
          "timeframe": "First 90 Days",
          "metric": "Implement strict typing (mypy) and increase test coverage to >85%."
        }
      ],
      "dayToDayDuties": [
        "Architect, build, and maintain scalable RESTful APIs using FastAPI and Django.",
        "Design efficient database schemas and optimize complex SQL queries in PostgreSQL.",
        "Implement asynchronous task queues using Celery and Redis.",
        "Conduct thorough code reviews and provide technical mentorship to mid-level engineers.",
        "Collaborate with DevOps to streamline CI/CD pipelines and deployment strategies."
      ],
      "customTags": [
        "Architecture",
        "Optimization"
      ],
      "extraNotes": "Focus heavily on system design and scalability patterns."
    },
    "qualifications": {
      "skills": {
        "technical": [
          {
            "skillId": "PY-EXP-01",
            "skillName": "Python 3.x",
            "importance": 10,
            "skillDescription": "Deep understanding of Python internals, concurrency, and memory management.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "FW-EXP-02",
            "skillName": "FastAPI / Django",
            "importance": 9,
            "skillDescription": "Production experience building robust web applications and APIs.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "DB-SQL-03",
            "skillName": "PostgreSQL",
            "importance": 8,
            "skillDescription": "Advanced SQL knowledge, indexing strategies, and performance tuning.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "CLOUD-04",
            "skillName": "AWS (Lambda/EC2/RDS)",
            "importance": 7,
            "skillDescription": "Experience deploying and managing cloud infrastructure.",
            "requiredProficiency": "Intermediate"
          }
        ],
        "soft": [
          {
            "skillId": "SOFT-MENTOR",
            "skillName": "Mentorship",
            "importance": 9,
            "skillDescription": "Ability to guide junior developers and foster a culture of learning.",
            "requiredProficiency": "Expert"
          },
          {
            "skillId": "SOFT-ARCH",
            "skillName": "System Thinking",
            "importance": 10,
            "skillDescription": "Ability to visualize complex system interactions and anticipate bottlenecks.",
            "requiredProficiency": "Expert"
          }
        ]
      },
      "experience": {
        "requiredYears": 5,
        "description": "5+ years of backend software development experience, with at least 3 years primarily using Python in a production environment."
      },
      "education": {
        "requiredCredential": "Bachelor's Degree in Computer Science or related engineering discipline.",
        "acceptsExperienceInLieu": true
      },
      "customTags": [
        "Senior Role"
      ],
      "extraNotes": "Open source contributions to Python ecosystem libraries are highly valued."
    },
    "evaluationStrategy": {
      "jobDescription": 70,
      "resume": 30
    },
    "customQuestions": [
      {
        "question": "Explain a complex bug you encountered in a distributed system and how you debugged it.",
        "expectedAnswer": "Looking for methodical debugging, use of observability tools, and root cause analysis."
      },
      {
        "question": "What is your strategy for handling database migrations in a high-traffic production app?",
        "expectedAnswer": "Should mention backward compatibility, phased rollouts, and locking minimization."
      }
    ],
    "applicantTasks": [
      {
        "taskId": "TASK-BE-ARCH",
        "maxUploadSizeMB": 5,
        "allowedFormats": [
          "pdf"
        ]
      }
    ],
    "companyContext": {
      "culture": "Engineering-led culture with a focus on code quality, testing, and work-life balance. We avoid crunch time by planning realistically.",
      "growthOpportunities": "Technical track leads to Staff/Principal Engineer roles. Management track available for those interested in Engineering Leadership.",
      "customTags": [
        "FinTech",
        "Stability"
      ],
      "extraNotes": "Weekly technical brown-bag sessions."
    },
    "compensation": {
      "salary": {
        "min": 140000,
        "max": 190000,
        "currency": "USD"
      },
      "benefits": [
        "Full Remote Setup Budget",
        "Health/Life/Disability Insurance",
        "Profit Sharing",
        "Flexible Working Hours",
        "Learning Stipend"
      ],
      "customTags": [
        "Senior-Band"
      ],
      "extraNotes": "Equity package included."
    },
    "meta": {
      "schemaVersion": "1.3",
      "lastUpdated": "2025-11-15T14:30:00Z",
      "completenessStatus": "Complete",
